import React from 'react'
import { FaArrowLeft } from 'react-icons/fa'
import { NavLink } from 'react-router-dom';

const back = () => {
    return (
        <div className='back-button'>
            <NavLink to="/home"><FaArrowLeft /></NavLink>
        </div>
    )
}

export default back
